import React from 'react';

class Pokemon extends React.Component {
  render() {
    const { name, type } = this.props.pokemons;
    return (
      <div className="App">
        <p>Nome: {name},
        <br/>Tipo: {type}</p>
      </div>
    );
  }
}

export default Pokemon;
